INSERT INTO `pages` (`id`, `category_id`, `title`, `description`, `created_at`, `updated_at`, `is_mobile`) VALUES
(1, 0, 'Overview', '<p>TravelB2BHub.com serves as a <strong>COMMISSION FREE, Business to Business, Tourism Trading Marketplace </strong>that connects Travel Agents, Hoteliers, and Event Planners throughout India.</p>\n<p>This portal facilitates the sale of tourism related services by directly <strong>connecting Buyers</strong> (Travel Agents, and Event Planners)<strong> with interested Sellers</strong> (Hoteliers, DMCs, Tour Operators, Travel Agents etc.).</p>\n<p>Buyers will submit their client''s requirements for Travel Package, Hotel Rooms, or Transportation, from their TravelB2BHub profile, and then freely negotiate deals in real-time with interested Sellers. </p>', '2017-05-10 06:58:56', '2017-08-22 05:41:43', 0),
(2, 0, 'Connect to a large, Business to Business marketplace', '<p>Buy and sell more Travel Packages, Hotel Rooms, and Transportation services by connecting directly with other Travel Agents, Hoteliers, and Event Planners across India.</p>', '2017-05-10 07:46:30', '2017-07-28 07:46:38', 0),
(3, 0, 'Pay us NO COMMISSION', '<p>Despite the value of your sale.</p>', '2017-05-10 07:46:48', '2017-05-12 05:13:30', 0),
(4, 0, 'Save time and effort through systematic requests/responses', '<p>No need to use WhatsApp groups, Google searches, or your phonebook to arrange Travel Packages for your clients - place a request and get responses in real-time.</p>', '2017-05-10 07:47:00', '2017-08-22 04:58:13', 0),
(5, 0, 'Pick the best deals', '<p>You will receive multiple responses for your request; you may choose what suits you best.</p>', '2017-05-10 07:47:12', '2017-07-28 07:46:36', 0),
(6, 0, 'Get multiple quotes for your requests', '<p>The Buyer will receive quotes from all the interested Suppliers.              </p>', '2017-05-10 07:47:27', '2017-05-12 05:11:26', 0),
(7, 0, 'Have unrestricted, real-time communication', '<p>Negotiate with the other party via phone and live chat, right from the beginning of the trade.</p>', '2017-05-10 07:47:42', '2017-05-12 05:11:17', 0),
(8, 0, 'Membership Plans', '<p><strong>Use of the Website and the Android App</strong> will remain<strong> free till </strong><strong><strong><span class="aBn" tabindex="0" data-term="goog_1358391284"><span class="aQJ">31st </span></span></strong>March 2018,</strong> with a limit of 100 Requests during this period; after which, the following nominal membership fee will be charged for maintenance of services:</p>', '2017-05-10 08:50:02', '2017-11-27 06:28:23', 0),
(9, 0, 'About Us', '<p class="about_first_p"><span class="dropcap">T</span>ravelB2BHub.com is a registered product of B2BHUB, a Partnership Company founded in Udaipur, Rajasthan, India. We have come together to make the Tourism business evolve and serve its clients better, by connecting Travel Agents, Hoteliers, and Event Planners to buy and sell services to each other, while paying no commission to us.</p>\n<div class="col-lg-4 col-md-4 col-sm-4 col-xs-12 margin-b20">\n<div class="icon">\n<div class="image"><img class="" src="/img/22.png" alt="" /></div>\n<div class="info">\n<h4 class="title">THE IDEA</h4>\n<p>The idea of creating this online network came to us when a Travel Agent friend complained about not being able to provide high quality service to his clients, where he didn’t have contacts. He complained how he would have to rely on disorganized and time consuming google searches, and WhatsApp groups to reach out to others to organize Travel Packages, Hotel Rooms, and Transportation, and sometimes fail.</p>\n</div>\n</div>\n</div>\n<div class="col-lg-4 col-md-4 col-sm-4 col-xs-12 margin-b20">\n<div class="icon">\n<div class="image"><img class="" src="/img/11.png" alt="" /></div>\n<div class="info">\n<h4 class="title">THE SOLUTION</h4>\n<p>We have created an integrated tourism trading network where Travel Agents and Event Planners can connect directly with other Travel Agents, Hoteliers, and Event Planners to sell more, and do it faster, while paying NO COMMISSION to us, regardless of the value of the sale. In addition, this network will reduce the marketing efforts of Hoteliers, by directly connecting them with Travel Agents and Event Planners.</p>\n</div>\n</div>\n</div>\n<div class="col-lg-4 col-md-4 col-sm-4 col-xs-12 margin-b20">\n<div class="icon">\n<div class="image"><img class="" src="/img/33.png" alt="" /></div>\n<div class="info">\n<h4 class="title">FUTURE</h4>\n<p>We are committed to make this network more efficient and more expansive, while reducing the costs of doing business, so the Hospitality Industry can grow and serve its clients better.</p>\n</div>\n</div>\n</div>', '2017-05-10 13:07:19', '2017-09-07 05:28:39', 0),
(10, 0, 'Privacy Policy', '<p class="p-policy-content" style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">TRAVELB2BHUB.com is a registered product of B2BHUB, a Partnership Company. Here on, the term ''You'' refers to the user or viewer of TRAVELB2BHUB.com and its related tools. We value the trust you place in TRAVELB2BHUB.com, which is why we insist on the highest standards for secure transactions and customer information privacy. The purpose of this website and its related tools is to connect Travel Agents, Hoteliers and Event Planners, interested in trading with each other, but all financial transactions performed by you, due to your connections through the website are not the responsibility of TRAVELB2BHUB.com or its parent company. Besides making payments for membership to our website/App for our services (through a secure payment gateway), we strongly encourage you not to share your financial information (bank details, credit card information etc.) with any other user via emails, messages, chats, or phone calls enabled by this Website/App, and we take no responsibility for any grievances due to acts performed in that regard. Please read the following statement to learn more about our Privacy Policy:</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">1. TRAVELB2BHUB.com Privacy Assurance</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">TRAVELB2BHUB.com promises that we will not sell or rent your personal information to third parties for their marketing purposes without your explicit consent. From time to time, we may reveal general statistical information about our website and visitors, such as number of visitors, number and type of services used, etc. Your trust and confidence are our highest priority.&nbsp;</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">Please note that email is not encrypted and is not considered a secure means of transmitting credit card numbers. The security and confidentiality of your information is extremely important to us. We have implemented technical, administrative, and physical security measures to protect any Personally Identifiable Information from unauthorized access and improper use. Please note that despite our efforts to protect information provided to us, we cannot guarantee that such information will not be lost, disclosed or accessed by accidental circumstances or by the unauthorized acts of others.&nbsp;</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">Your communications may route through a number of countries before being delivered - this is the nature of internet. We cannot accept responsibility for any unauthorized access or loss of personal information that is beyond our control.</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">2. Type of Personal Information collected</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">We collect personally identifiable information (email address, name, phone number, demographic data, etc.) from every Travel Agent, Hotelier, and Event Planner who creates an account with Travelb2bhub.com. While you can browse some sections of our website and App without being a registered member, certain activities (such as placing a request or responding to a request) do require registration. We will use your contact information to send you offers based on your previous orders and your interests. We use data collection devices such as "cookies" on certain pages of the Site to help analyze our web page flow, measure promotional effectiveness, and promote trust and safety.&nbsp;</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">"Cookies" are small files which identify your computer to our server as a unique user when you visit certain pages on the Site and they are stored by your Internet browser on your computer''s hard drive. We offer certain features that are only available through the use of a "cookie". We also use cookies to allow you to enter your password less frequently during a session. Cookies can also help us provide information that is targeted to your interests. Most cookies are "session cookies," meaning that they are automatically deleted from your hard drive at the end of a session. You are always free to decline our cookies if your browser permits, although in that case you may not be able to use full functionality of the Site. We only use cookies for your convenience in using the Site and not for obtaining or using any other information about you. We do not control the use of cookies by third parties.</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">3. Your disclosure of your information</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">Please note that that any information you disclose in feedback, reviews and ratings with respect to your experiences in using our services, and those of the Travel Agents, Hoteliers, or Event Planners matched with you becomes public information and you should exercise caution when deciding to disclose your personal information. We may, from time to time, make links to other websites available to you; please remember that any information that is disclosed in these areas also becomes public information and you should exercise caution when deciding to disclose your personal information.</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">4. Interactions with other users</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">If you transact business with a Merchant whose link or contacts originates from TRAVELB2BHUB.com or a Merchant catalog or website "presented by" TRAVELB2BHUB.com, the information you provide to that Merchant, such as your credit card number and contact information etc., is provided to the Merchant and NOT to TRAVELB2BHUB.com. TRAVELB2BHUB.com and its parent company bear no responsibility of the financial transactions between any users of this website/App. Please note that the Merchant may, if you do not specify to the contrary, share your name and postal and email addresses with third parties, including TRAVELB2BHUB. You should also know that these Merchants have their own privacy policies and data collection practices and are not covered by the TRAVELB2BHUB Privacy Policy. We do not have any control over and therefore take no responsibility or liability for these independent policies. For more information regarding Merchants appearing on TRAVELB2BHUB or other Merchants who send catalogs or host websites "presented by" TRAVELB2BHUB and their privacy policies, please see the Merchant''s website or contact them at the contact information provided on their website/catalog. Merchants that have links on the TRAVELB2BHUB site may collect personally identifiable information about you. The information practices of these Merchants are not covered by the TRAVELB2BHUB Privacy Policy.</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">5. Changes to this Privacy Policy Statement</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">From time to time, we may use the information you provide us for new, unanticipated uses not previously addressed in our Privacy Policy. If our information practices change at some time in the future we will post the policy changes on the privacy page of our Website to notify you of these changes, and the revised Privacy Policy will apply to all of your personal information that we have on file, provided, however, that we will continue to honor any past requests not to share your information with third parties. You should check our Website periodically for more information on how we use the data we collect. If there is a material change in the manner we use data we collect, we will update this Privacy Policy to reflect these changes.</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;"> 6. Conflict in Terms</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">\r\nIt is our goal to make our privacy practices easy to understand. We have created this easy-to-read Privacy Policy Statement with that goal in mind. Some browsers utilize privacy enhancing technology to translate our Privacy Policy Statement into a computer readable format. The technology then requires that the computer format be translated back into human readable format for you to read. This translation back into human readable format is often referred to as a Policy Summary. It is possible that through these translations, the Policy Summary may unintentionally end up being inconsistent with the Privacy Policy upon which it is based. It might fail to address an issue or it might address an issue not raised in our Privacy Policy. For this reason, you should rely on our Privacy Policy as the most accurate and definitive description of our practices.</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">NOTE:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.</p>', '2017-05-10 13:19:57', '2017-09-07 09:57:49', 0),
(11, 0, 'Terms & Conditions', '<p class="p-policy-content" style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">TRAVELB2BHUB.com is a registered product of B2BHUB, a Partnership Company. Here on, the term ''You'' refers to the user or viewer of TRAVELB2BHUB.com and its related tools. The purpose of this website, Apps, and its related tools is to connect Travel Agents, Hoteliers and Event Planners, interested in trading with each other, but all financial transactions performed by you, due to your connections made through the website are not the responsibility of TRAVELB2BHUB.com or its parent company. Please read the following Terms and Conditions for use of TRAVELB2BHUB.com and its related tools:</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">Eligibility</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">Use of TRAVELB2BHUB.com is available only to persons who can form a legally binding contract under the Indian Contract Act, 1872. If you are under the age of 18, you cannot be a registered member of this site, and use its related tools.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">This website/APP will serve as a B2B network that connects Travel Agents, Hoteliers, and Event Planners, within India, with each other to enable them to sell and market tourism related services better, and even in locations were they didn’t have reach or contacts. This is a B2B networking site and is NOT meant to cater directly to individual travelers.<strong style="box-sizing: border-box;">The terms of use for each category of users are as follows:</strong></p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">1)TRAVEL AGENTS:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">You, as a travel agent registered on this Portal/App, will be able connect and collaborate with other Travel Agents, Hotels, and Event Planners (currently within India) to perform the following two tasks to increase your business:</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">i. Place requests for travel requirements like Travel Packages, Hotels, or Transport for any location of your choice (currently within India), and get competitive prices from Travel Agents or Hotels, and then finalize the deal of your choice.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">ii. Respond to requests placed by other Travel Agents for Packages, hotels, or transport for the region where you have chosen to have reach and can provide good service. </p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;"><strong style="box-sizing: border-box;">Important:</strong> This is a networking site that facilitates structured interaction to enhance user experience while doing business, but facilitating and managing financial transactions like transfer of money between users is beyond the scope of this website and its tools. TRAVELB2BHUB.com and its parent company take no responsibility for the financial transactions or other commitments agreed between the users.</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">2)HOTELIERS:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">You, as a Hotelier/ Hotel’s Sales Manager once registered on this Portal/App, will be able connect and collaborate with Travel Agents, and Event Planners to sell your hotel rooms by responding to requests placed by them in real-time. </p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;"><strong style="box-sizing: border-box;">Important:</strong> This is a networking site that facilitates structured interaction to enhance user experience while doing business, but facilitating and managing financial transactions like transfer of money between users is beyond the scope of this website and its tools. TRAVELB2BHUB.com and its parent company take no responsibility for the financial transactions or other commitments agreed between the users.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;"><strong style="box-sizing: border-box;">3)EVENT PLANNERS:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">You, as an Event Planner registered on this Portal/App, will be able connect and collaborate with other Travel Agents, and Hoteliers to place requests for travel requirements like Travel Packages, Hotels, or Transport for any location of your choice (currently within India), and get competitive prices from Travel Agents or Hotels, and then finalize the deal of your choice.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;"><strong style="box-sizing: border-box;">Important:</strong> This is a networking site that facilitates structured interaction to enhance user experience while doing business, but facilitating and managing financial transactions like transfer of money between users is beyond the scope of this website and its tools. TRAVELB2BHUB.com and its parent company take no responsibility for the financial transactions or other commitments agreed between the users.</p>\r\n<p><strong style="box-sizing: border-box; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">General Conditions:</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">• The content of the pages of this website and related tools is subject to change without notice.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">• The user may register for free, but will be required to pay a nominal fixed membership fee to use certain services. The membership fee, a user pays prior to using certain services of TRAVELB2BHUB.com are nonrefundable.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #444444; font-family: Raleway-Regular; font-size: 14px; letter-spacing: 1px; line-height: 28px; text-align: justify;">• Your use of any information 