g this website and its related tools to customercare@travelb2bhub.com.</p>', '2017-05-10 13:20:19', '2017-05-10 13:54:32', 0),
(12, 0, 'FAQs', '<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="panel with-nav-tabs panel-default">\r\n<div class="panel-heading">\r\n<ul class="nav nav-tabs">\r\n<li class="active"><a href="#travel_agent" data-toggle="tab">Travel Agent</a></li>\r\n<li><a href="#event_planner" data-toggle="tab">Event Planner</a></li>\r\n<li><a href="#hotelier" data-toggle="tab">Hotelier</a></li>\r\n</ul>\r\n</div>\r\n<div class="panel-body">\r\n<div class="tab-content">\r\n<div id="travel_agent" class="tab-pane fade in active">\r\n<p><strong>Q1. Do I really pay NO commission to TravelB2BHub for connecting me to Buyers/ Sellers?</strong></p>\r\n<p><strong>Ans.</strong> Yes, TravelB2BHub does not charge any commission despite the value of the transaction.</p>\r\n<p><strong> Q2. Does this portal/App have an inventory management system (API based) that provides leads of Travel Packages, Hotel Rooms, or Transportation Services to Travel Agents?</strong></p>\r\n<p><strong>Ans.</strong> No, TravelB2BHub serves as a B2B network that directly connects Travel Agents with suppliers (other Travel Agents, DMCs, Tour Operators, or Hoteliers) based on the destination of the requirement. It allows added flexibility in negotiating deals, and in reaching locations where users didn’t have contacts. It speeds up the process of searching and negotiating deals by providing an organized step-by-step process to users.</p>\r\n<p><strong>Q3. What are the steps taken to ensure that the businesses listed on TravelB2Bhub are bona fide businesses?</strong></p>\r\n<p><strong>Ans.</strong> Each user with a profile on TravelB2BHub is required to provide their Company PAN Card details, Photographs of their office/ Hotel, Shop Act/ Registration, and Certificates. Users can view the percentage completeness of each other’s profile to assess the veracity of the other party. After existing on the portal/App for some time, each user will have a transaction history, rating and reviews which will be visible to other users.</p>\r\n<p><strong>Q4. Do I get charged if no one responds to my request?</strong></p>\r\n<p><strong>Ans.</strong> No, you will not be charged if you close your request before any response is received on it.</p>\r\n<p><strong>Q5. Do I get charged for responding to a request placed by others? </strong></p>\r\n<p><strong>Ans.</strong> No, even if you use up your quota of requests you will still be able to respond to requests by other users for the entire term of 1 year starting from the date you purchased your membership</p>\r\n<p><strong>Q6. I own a Travel Agency, do I need to create multiple Usernames for my employees?</strong></p>\r\n<p><strong>Ans.</strong> TravelB2BHub provides you the flexibility to allow all your employees to login to the portal/App using a single Username. However, you can create multiple accounts if you like.</p>\r\n<p><strong>Q7. What if I use up my quota of requests and want to place more requests?</strong></p>\r\n<p><strong>Ans.</strong> You may simply purchase more by renewing your membership.</p>\r\n<p><strong>Q8. Does TravelB2BHub provide services of transferring funds between the parties connecting on the website/App to buy and sell services?</strong></p>\r\n<p><strong>Ans.</strong> No, this platform is strictly to connect businesses interested in buying and selling services related to the tourism industry. Financial transactions are the responsibility of parties involved and must be carried out using their own money transfer methods.</p>\r\n<p><strong>Q9. What if someone doesn’t uphold the terms of negotiations that he agreed on?</strong></p>\r\n<p><strong>Ans.</strong> We have a Reviewing/ Rating functionality available for you to rate the quality of your interaction with the other party that will be visible to all the users. Also, you may Block a user if the interaction is below normal business expectations. TravelB2BHub will monitor all the Blocked users and remove any repeat offenders from the website. Credibility is the key to long term business relations and we hope that businesses listed on this website will uphold that expectation.</p>\r\n</div>\r\n<div id="event_planner" class="tab-pane fade">\r\n<p><strong>Q1. Do I really pay NO COMMISSION to TravelB2BHub for connecting me to Sellers?</strong></p>\r\n<p><strong>Ans.</strong> Yes, TravelB2BHub does not charge any commission despite the value of the transaction.</p>\r\n<p><strong>Q2. Does this portal/App have an inventory management system (API based) that provides leads of Travel Packages, Hotel Rooms, or Transportation Services to Event Planners?</strong></p>\r\n<p><strong>Ans.</strong> No, TravelB2BHub serves as a B2B network that directly connects Event Planners with suppliers (Travel Agents, DMCs, Tour Operators, or Hoteliers) based on the destination of the requirement. It allows added flexibility in negotiating deals, and in reaching locations where users didn’t have contacts. It speeds up the process of searching and negotiating deals by providing an organized step-by-step process to users.</p>\r\n<p><strong>Q3. What is the region of operation of this portal/App?</strong></p>\r\n<p><strong>Ans.</strong> TravelB2BHub is an ALL INDIA Network designed to directly connect Event Planners with TRAVEL AGENTS (DMCs, TOUR OPERATORS etc.), and Hoteliers.</p>\r\n<p><strong>Q4. What are the steps taken to ensure that the businesses listed on TravelB2Bhub are bona fide businesses?</strong></p>\r\n<p><strong>Ans.</strong> Each user with a profile on TravelB2BHub is required to provide their Company PAN Card details, Photographs of their office/ Hotel, Shop Act/ Registration, and Certificates. Users can view the percentage completeness of each other’s profile to assess the veracity of the other party. After existing on the portal/App for some time, each user will have a transaction history, rating and reviews which will be visible to other users.</p>\r\n<p><strong>Q5. Do I get charged if no one responds to my request?</strong></p>\r\n<p><strong>Ans.</strong> No, you will not be charged if you close your request before any response is received on it.</p>\r\n<p><strong>Q6. I own an Event Planning company, do I need to create multiple Usernames for my employees?</strong></p>\r\n<p><strong>Ans.</strong> TravelB2BHub provides you the flexibility to allow all your employees to login to the portal/App using a single Username. However, you can create multiple accounts if you like.</p>\r\n<p><strong>Q7. What if I use up my quota of requests and want to place more requests?</strong></p>\r\n<p><strong>Ans.</strong> You may simply purchase more by renewing your membership.</p>\r\n<p><strong>Q8. Does TravelB2BHub provide services of transferring funds between the parties connecting on the website/App to buy and sell services?</strong></p>\r\n<p><strong>Ans.</strong> No, this platform is strictly to connect businesses interested in buying and selling services related to the tourism industry. Financial transactions are the responsibility of parties involved and must be carried out using their own money transfer methods.</p>\r\n<p><strong>Q9. What if someone doesn’t uphold the terms of negotiations that he agreed on?</strong></p>\r\n<p><strong>Ans.</strong> We have a Reviewing/ Rating functionality available for you to rate the quality of your interaction with the other party that will be visible to all the users. Also, you may Block a user if the interaction is below normal business expectations. TravelB2BHub will monitor all the Blocked users and remove any repeat offenders from the website. Credibility is the key to long term business relations and we hope that businesses listed on this website will uphold that expectation.</p>\r\n</div>\r\n<div id="hotelier" class="tab-pane fade">\r\n<p><strong>Q1. Do I really pay NO COMMISSION to TravelB2BHub for connecting me to Buyers?</strong></p>\r\n<p><strong>Ans.</strong> Yes, TravelB2BHub does not charge any commission despite the value of the transaction.</p>\r\n<p><strong>Q2. Does this portal/App function as an inventory management system (API based) that provides leads of Hotel Rooms to Travel Agents, DMCs, or Tour Operators?</strong></p>\r\n<p><strong>Ans.</strong> No, TravelB2BHub serves as a B2B network that directly connects buyer with suppliers (Hoteliers, Travel Agents, DMCs, Tour Operators) based on the destination of the buyer’s requirement. It allows added flexibility in negotiating deals, and in reaching locations where users didn’t have contacts. It speeds up the process of searching and negotiating deals by providing an organized step-by-step process to users.</p>\r\n<p><strong>Q3. What is the region of operation of this portal/App?</strong></p>\r\n<p><strong>Ans.</strong> TravelB2BHub is an ALL INDIA Network designed to directly connect TRAVEL AGENTS (DMCs, TOUR OPERATORS etc.), Event Planners with Hoteliers.</p>\r\n<p><strong>Q4. What are the steps taken to ensure that the businesses listed on TravelB2Bhub are bona fide businesses?</strong></p>\r\n<p><strong>Ans.</strong> Each user with a profile on TravelB2BHub is required to provide their Company PAN Card details, Photographs of their office/ Hotel, Shop Act/ Registration, and Certificates. Users can view the percentage completeness of each other’s profile to assess the veracity of the other party. After existing on the portal/App for some time, each user will have a transaction history, rating and reviews which will be visible to other users.</p>\r\n<p><strong>Q5. Do I get charged for responding to a request for hotel rooms received by me on my profile?</strong></p>\r\n<p><strong>Ans.</strong> No, once you have paid the membership fee, you will not be charged any fee for responding to requests during the validity period of the membership.</p>\r\n<p><strong>Q6. I own multiple hotel properties; do I need to create different Usernames for each of them?</strong></p>\r\n<p><strong>Ans.</strong> Yes, each property must have its own profile. This will ensure that only relevant requests based on Location, Hotel Type, Price Range etc. are sent to the User.</p>\r\n<p><strong>Q7. Can I market my Hotel on TravelB2BHub?</strong></p>\r\n<p><strong>Ans.</strong> Please click on <a href="promotions">Promote your hotel</a> to find out more.</p>\r\n<p><strong>Q8. Does TravelB2BHub provide services of transferring funds between the parties connecting on the website/App to buy and sell services?</strong></p>\r\n<p><strong>Ans.</strong> No, this platform is strictly to connect businesses interested in buying and selling services related to the tourism industry. Financial transactions are the responsibility of parties involved and must be carried out using their own money transfer methods.</p>\r\n<p><strong>Q9. What if someone doesn’t uphold the terms of negotiations that he agreed on?</strong></p>\r\n<p><strong>Ans.</strong> We have a Reviewing/ Rating functionality available for you to rate the quality of your interaction with the other party that will be visible to all the users. Also, you may Block a user if the interaction is below normal business expectations. TravelB2BHub will monitor all the Blocked users and remove any repeat offenders from the website. Credibility is the key to long term business relations and we hope that businesses listed on this website will uphold that expectation.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2017-06-07 05:35:25', '2017-09-01 12:42:59', 0),
(13, 0, 'Promote Your Hotel', '<div id="accordion" class="panel-group">\n<div class="panel panel-default">\n<div class="panel-heading">\n<h4 class="panel-title"><a class="accordion-toggle" href="#collapseOne" data-parent="#accordion" data-toggle="collapse"> Why promote your hotel at TravelB2BHub? </a></h4>\n</div>\n<div id="collapseOne" class="panel-collapse collapse in">\n<div class="panel-body">\n<h5>Promoting your Hotel on TravelB2BHub helps you:</h5>\n<ol>\n<li><strong> Increase your reach: </strong>Increase your business by connecting with new Travel Agents/ Event Planners to build lasting relationships.</li>\n<li><strong> Do Targeted Marketing: </strong>Pick specific cities where you want to drive business from, or reach new cities where you didn’t previously have a marketing presence.</li>\n<li><strong> Analyze your promotion’s performance: </strong>On your personal profile, you will be able to see how your promotion is performing, and the number/ type of people/regions responded to your promotions initiative.</li>\n<li><strong> Pay nominal price: </strong>Do all of the above at a small fraction of the cost of attending Travel and Tourism Fairs, or using sales reps.</li>\n</ol>\n</div>\n</div>\n</div>\n<div class="panel panel-default">\n<div class="panel-heading">\n<h4 class="panel-title"><a class="accordion-toggle collapsed" href="#collapseTwo" data-parent="#accordion" data-toggle="collapse"> How it works? </a></h4>\n</div>\n<div id="collapseTwo" class="panel-collapse collapse" style="height: 0px;">\n<div class="panel-body">\n<p>You, as a <strong>Hotelier/ Hotel’s representative,</strong> may pick the cities where you want your promotional coverage. The Hotel’s Photo and details will be featured on the TravelB2BHub profiles of all the Travel Agents and Event Planners from the chosen cities for a set time period.</p>\n<p>In order to provide transparency in what the promoter will get for their investment, they will be able to see the count of Travel Agents and Event Planners present in each city before they finalize the payment.</p>\n<p>After initiating promotions, the performance statistics of the initiative will be available on the Hotelier’s TravelB2BHub profile.</p>\n</div>\n</div>\n</div>\n<div class="panel panel-default">\n<div class="panel-heading">\n<h4 class="panel-title"><a class="accordion-toggle collapsed" href="#collapseThree" data-parent="#accordion" data-toggle="collapse"> Getting Started? </a></h4>\n</div>\n<div id="collapseThree" class="panel-collapse collapse" style="height: 0px;">\n<div class="panel-body">\n<h5>There is an easy four step process to promote your hotel on TravelB2BHub:</h5>\n<ul>\n<li><strong>Step 1: </strong>Click on <a href="http://192.168.3.82/b2b/users/login">Promote your Hotel</a> (you must be a registered Hotelier on TravelB2BHub)</li>\n<li><strong>Step 2: </strong> Fill a short Form with your Hotel’s details and target cities where you want Travel Agents/ Event Planners to see your promotion.</li>\n<li><strong>Step 3: </strong>Review your Advertisement and Finalize it.</li>\n<li><strong>Step 4: </strong>Submit and Make Payments.</li>\n</ul>\n</div>\n</div>\n</div>\n</div>', '2017-06-15 11:49:17', '2017-07-31 11:18:08', 0),
(14, 0, 'Why promote your hotel at TravelB2BHub?', '<div class="panel-body">\r\n<h5>Promoting your Hotel on TravelB2BHub helps you:</h5>\r\n<ol>\r\n<li><strong>1. Increase your reach: </strong>Increase your business by connecting with new Travel Agents/ Event Planners to build lasting relationships.</li>\r\n<li><strong>2. Do Targeted Marketing: </strong>Pick specific cities where you want to drive business from, or reach new cities where you didn’t previously have a marketing presence.</li>\r\n<li><strong>3. Analyze your promotion’s performance: </strong>On your personal profile, you will be able to see how your promotion is performing, and the number/ type of people/regions responded to your promotions initiative.</li>\r\n<li><strong>4. Pay nominal price: </strong>Do all of the above at a small fraction of the cost of attending Travel and Tourism Fairs, or using sales reps.</li>\r\n</ol>\r\n</div>', '2017-10-23 00:00:00', '2017-10-23 00:00:00', 0),
