(26, 12, 'Hotelier', '        <p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%;color:#C00000">All Promotions will be\nfree till 31<sup>th</sup> May 2018</span></b><span lang="EN-US" style="font-size:\n12.0pt;line-height:115%"><o:p></o:p></span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%;color:#C00000">Why promote your hotel at\nTravelB2BHub?<o:p></o:p></span></b></p><p class="MsoNormal"><span lang="EN-US" style="font-size:12.0pt;line-height:115%">Promoting\nyour Hotel on TravelB2BHub helps you:<o:p></o:p></span></p><p class="MsoListParagraphCxSpFirst" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:115%;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin">1.&nbsp;</span><b><span lang="EN-US" style="font-size:12.0pt;\nline-height:115%">Increase your business and reach</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%">: Increase your business by promoting\nyour Hotel to all the registered Travel Agents and Event Planner.<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:115%;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin">2.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;</span></span><b><span lang="EN-US" style="font-size:12.0pt;\nline-height:115%">Analyze your promotion’s performance:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%"> On your personal profile,\nyou will be able to see how your promotion is performing, and the number/ type\nof people responding to your promotion initiative. <o:p></o:p></span></p><p class="MsoListParagraphCxSpLast" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:115%;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin">3&nbsp;&nbsp;</span><b><span lang="EN-US" style="font-size:12.0pt;\nline-height:115%">Pay nominal price:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%"> Do all of the above at a small\nfraction of the cost of attending Travel and Tourism Fairs, doing SEO/SMO or\nusing sales reps.<o:p></o:p></span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%;color:#C00000">How it works?<o:p></o:p></span></b></p><p class="MsoNormal"><span lang="EN-US" style="font-size:12.0pt;line-height:115%">You,\nas a Hotelier/ Hotel’s representative, will be required to fill a short form\nwith your hotel’s contact information, tariff, details and photographs that you\nwant to share during the promotion. The Hotel’s Photo and details will be\nfeatured on the TravelB2BHub profiles of ALL the Travel Agents and Event\nPlanners from cities across India for a time period chosen by you. <o:p></o:p></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size:12.0pt;line-height:115%">In\norder to provide transparency in what the promoter will get for their investment,\nyou<a name="_GoBack"></a> will be able to see the count of Travel Agents and Event\nPlanners Liking or Viewing the promotion, in the Reports section of their\nprofile.<o:p></o:p></span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%;color:#C00000">Getting Started: <o:p></o:p></span></b></p><p class="MsoNormal"><span lang="EN-US" style="font-size:12.0pt;line-height:115%">There\nis an easy three step process to promote your hotel on TravelB2BHub:</span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%">Step 1:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%"> Fill a short Form with your Hotel’s\ndetails.<o:p></o:p></span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%">Step 2:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%"> Review your Advertisement and\nFinalize it.<o:p></o:p></span></p><p class="MsoNormal">\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%">Step 3:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%"> Submit and Make Payments.<o:p></o:p></span></p> ', '2017-10-23 00:00:00', '2017-10-23 00:00:00', 1);
