(27, 14, '', '      <p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%;color:#C00000">All Promotions will be\nfree till 31<sup>th</sup> May 2018</span></b><span lang="EN-US" style="font-size:\n12.0pt;line-height:115%"><o:p></o:p></span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%;color:#C00000">Why promote your Event\nPlanning Company at TravelB2BHub?<o:p></o:p></span></b></p><p class="MsoNormal"><span lang="EN-US" style="font-size:12.0pt;line-height:115%">Promoting\nyour Event Planning Company on TravelB2BHub helps you:<o:p></o:p></span></p><p class="MsoListParagraphCxSpFirst" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:115%;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin">1.</span><span lang="EN-US" style="line-height: 115%; font-family: &quot;Times New Roman&quot;; font-size: 9.33333px;">&nbsp;</span><b><span lang="EN-US" style="font-size:12.0pt;\nline-height:115%">Directly promote your Event Planning Company without paying us\nany commission: </span></b><span lang="EN-US" style="font-size:12.0pt;line-height:\n115%">Other Event Planners and Hoteliers will be able to shortlist your\nfeatured Event Planning services based on their requirements, and directly call\nyou on your featured number to buy your services.<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:115%;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin">2&nbsp;&nbsp;</span><b><span lang="EN-US" style="font-size:12.0pt;\nline-height:115%">Increase your reach</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%">: Increase your business by connecting\nwith new Event Planners, and Hoteliers to build lasting relationships.<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:115%;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin">3&nbsp;&nbsp;</span><b><span lang="EN-US" style="font-size:12.0pt;\nline-height:115%">Analyze your promotion’s performance:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%"> On your personal profile,\nyou will be able to see how your promotion is performing, and the number/ type\nof people responding to your promotion initiative. <o:p></o:p></span></p><p class="MsoListParagraphCxSpLast" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:115%;mso-bidi-font-family:Calibri;\nmso-bidi-theme-font:minor-latin">4.</span><span lang="EN-US" style="line-height: 115%; font-family: &quot;Times New Roman&quot;; font-size: 9.33333px;">&nbsp;</span><b><span lang="EN-US" style="font-size:12.0pt;\nline-height:115%">Pay nominal price:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%"> Do all of the above at a small\nfraction of the cost of attending Travel and Tourism Fairs, doing SEO/SMO, or running\nAds.<o:p></o:p></span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%;color:#C00000">How it works?<o:p></o:p></span></b></p><p class="MsoNormal"><span lang="EN-US" style="font-size:12.0pt;line-height:115%">You\nwill be required to fill a short form with your Event Planning Company’s details,\ncontact information, and banner that you want to share during the promotion. The\nBanner photo and details will be featured on the TravelB2BHub profiles of ALL\nthe Hoteliers, and Event Planners from cities across India for a time period\nchosen by you. <o:p></o:p></span></p><p class="MsoNormal"><span lang="EN-US" style="font-size:12.0pt;line-height:115%">In\norder to provide transparency in what the promoter will get for their investment,\nyou will be able to see the count of Travel Agents, Hoteliers, and Event\nPlanners Liking or Viewing the promotion, in the Reports section of their\nprofile.<a name="_GoBack"></a><o:p></o:p></span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%;color:#C00000">Getting Started: <o:p></o:p></span></b></p><p class="MsoNormal"><span lang="EN-US" style="font-size:12.0pt;line-height:115%">There\nis an easy three step process to promote your Event Planning Company<b> </b>on TravelB2BHub:</span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%">Step 1:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%"> Fill a short Form with your Company’s\ndetails.<o:p></o:p></span></p><p class="MsoNormal"><b><span lang="EN-US" style="font-size:12.0pt;line-height:115%">Step 2:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:115%"> Review your Advertisement and\nFinalize it.<o:p></o:p></span></p><p class="MsoNormal"><span style="font-size: x-large;"><b style=""><span lang="EN-US" style="line-height: 115%; font-family: Calibri, sans-serif;">Step 3:</span></b><span lang="EN-US" style="line-height: 115%; font-family: Calibri, sans-serif;"> Submit and Make\nPayments.</span></span><br></p> ', '2018-03-22 00:00:00', '2018-03-22 00:00:00', 0),
(28, 15, 'Taxi Fleet Promotion', '<div class="panel-body">\n<h5 style="text-align: left;">Promoting your Taxi Fleet on TravelB2BHub helps you:</h5>\n<p style="text-align: left;">1. <strong> Increase your reach: </strong>Increase your business by connecting with new Travel Agents/ Event Planners to build lasting relationships.</p>\n<p style="text-align: left;">2. <strong> Do Targeted Marketing: </strong>Pick specific cities where you want to drive business from, or reach new cities where you didn’t previously have a marketing presence.</p>\n<p style="text-align: left;">3. <strong> Analyze your promotion’s performance: </strong>On your personal profile, you will be able to see how your promotion is performing, and the number/ type of people/regions responded to your promotions initiative.</p>\n<p style="text-align: left;">4. <strong> Pay nominal price: </strong>Do all of the above at a small fraction of the cost of attending Travel and Tourism Fairs, or using sales reps.</p>\n</div>', '2018-03-22 00:00:00', '2018-03-22 00:00:00', 0),
