(24, 'Chardhaam Yatra', 0, 0, '2018-04-25', 0, '100000.00', 1, 'A relatively smaller circuit of Hindu pilgrimage is formed by the four hallowed places of Indian Himalayas, which are also known as Chota Char Dham. ... Alternately called Char Dham of Himalayas or Char Dham of Uttarakhand, the revered group possesses four sacred sites - Badrinath ...\r\n?Yatra Map · ?Chardham Hotels · ?Chardham Pilgrimage Tour · ?Char Dham Packages', 'Char Dham is referred to the four Hindu religious sites in Uttarakhand state of India. These are Yamunotri, Gangotri, Badrinath and Kedarnath. Nestled in the lap of majestic Himalayas, these four sites are the epicenter of religious activity in north India. Traditionally, the Chardham Yatra is undertaken from the west to the east ', 'images/PostTravelPackages/46/Chardhaam Yatra/image/46.jpg', '', 2, '0.00', 0, '2018-05-19', 'More than 15 Days', 46, '2018-04-21 09:58:09', 0, '2018-05-24 07:21:08', 0, 0, 1, 11),
